const Signup = () => {



    return (

        <div className="signup">

            <form className="form-sigup">
                <label className="logo-signup">Sign Up</label><br /><br />


                {/* <label className="label-l">Full Name: </label> */}
                <input type="text" className="text-feiled" placeholder="Fullname" required /><br /><br />


                {/* <label className="label-l">Emaile: </label> */}
                <input type="email" className="text-feiled" placeholder="Emaile" required /><br /><br />


                <input type="text" className="text-feiled" placeholder="PhoneNumber" required /><br /><br />

                <input type="password" className="text-feiled" placeholder="password" required /><br /><br />
                <button type="button" class="btn btn-primary btn-lg">Create User</button>

            </form>

        </div>
    );
}
export default Signup;
